import { makeStyles } from '@material-ui/core'


export default makeStyles ((theme) => ({
        root: {
          width: '95%',
          maxHeight: 420,
          marginTop: 20,
          marginLeft: 40, 
          marginRight: 20,
          border: 5
        },
        container: {
          maxHeight: 420,
        },
        box:{
          width: '100%',
          maxHeight: 800,
          marginTop: 70,
          marginLeft: 40, 
          marginRight: 40,
          border: 5
        },
        chart: {
          width: '95%',
          maxHeight: 420,
          marginTop: 20,
          marginLeft: 40, 
          marginRight: 20,
          border: 5
        }

}));
